import "./App.css";
import logoSvg from "../src/images/svg/header_logo.svg";

function App() {
  return (
    <div className="wrap">
      <header className="header__section">

          <div className="header__content">
            <div className="header__logo">
              <img src={logoSvg} className="header__logo_svg" />
            </div>
            <div className="header__shop"></div>
          </div>
      </header>
    </div>
  );
}

export default App;
